 function Logout(setUserLoggedIn){
    sessionStorage.removeItem("token");
    setUserLoggedIn(false)
}
function Login(setUserLoggedIn, token){
    sessionStorage.setItem("token", JSON.stringify(token));
    setUserLoggedIn(true);
}
export  {Logout, Login}
